-- Papita V3 - Script Protegido (Avanzado)
local b='ABCDEFGHIJKLMNOPQRSTUVWXYZabcdefghijklmnopqrstuvwxyz0123456789+/'

function dec(data)
    local function d(s)
        return (b:find(s, 1, true) or 0) - 1
    end
    data = data:gsub('[^'..b..'=]', '')
    return (data:gsub('.', function(x)
        if x == '=' then return '' end
        local r,f='',d(x)
        for i=5,0,-1 do r=r..(f//2^i%2 == 1 and '1' or '0') end
        return r
    end):gsub('%d%d%d?%d?%d?%d?%d?%d?', function(x)
        if #x ~= 8 then return '' end
        local c=0
        for i=1,8 do c=c+(x:sub(i,i)=='1' and 2^(8-i) or 0) end
        return string.char(c)
    end))
end

local data = [[]]
local s = dec(data)
s = assert(loadstring(require("zlib").decompress(s))) or assert(loadstring(s))
s()
